export default function App() {
    return ( <Container className = "container border border-secondary rounded-3" >
        <Row className = "row" >
        <Col className = "col" >
        <TodaysDate / >
          </Col>
        <Col className = "col-sm-8" >
        <SearchForm / >
        <h2 className = "dailyWeatherHeading" > The Next Six Days </h2> 
        </Col> 
      </Row>
